// reportWebVitals.js

// This function will log performance metrics to the console
export function reportWebVitals(metric) {
  console.log(metric);  // Logs performance metrics (like LCP, FID, etc.)
  // You can send this metric data to your analytics endpoint, like Google Analytics
}
